import React from "react";
import { useNavigate, useParams } from "react-router-dom";
import * as TT from "../styles/StyledTimeTable";

const TimeTable = () => {
  const navigate = useNavigate();

  // 이미지 상태 관리
  const [isClicked1001, setIsClicked1001] = useState(true); // 처음에는 Clicked1001.svg로 설정
  const [isClicked1002, setIsClicked1002] = useState(false); // 처음에는 unClicked1002.svg로 설정

  // 이미지 클릭
  const handleClick1001 = () => {
    setIsClicked1001(true); // 1001 클릭 시 true
    setIsClicked1002(false); // 1002는 false로
  };

  const handleClick1002 = () => {
    setIsClicked1001(false); // 1001은 false로
    setIsClicked1002(true); // 1002 클릭 시 true

    const goback = () => {
      navigate(`/`);
    };

    return (
      <TT.Container>
        <TT.Header>
          <TT.Back>
            <img
              id="back"
              src={`${process.env.PUBLIC_URL}/images/Backbtn.svg`}
              alt="back"
              onClick={goback}
            />
          </TT.Back>
          <TT.Title>타임테이블</TT.Title>
        </TT.Header>
        <TT.Background>
          <img
            src={`${process.env.PUBLIC_URL}/images/TimeTableBack.svg`}
            alt="background"
          />
        </TT.Background>
        <TT.Date>
          <img
            id="1001"
            src={`${process.env.PUBLIC_URL}/images/${
              isClicked1001 ? "Clicked1001.svg" : "unClicked1001.svg"
            }`}
          ></img>
          <img
            id="1002"
            src={`${process.env.PUBLIC_URL}/images/${
              isClicked1002 ? "Clicked1002.svg" : "unClicked1002.svg"
            }`}
          ></img>
        </TT.Date>
        <TT.Table>
          <TT.Menu>
            <TT.Menu1>
              <div id="title">부스</div>
              <div id="line1"></div>
            </TT.Menu1>
            <TT.Menu1>
              <div id="title">공연</div>
              <div id="line2"></div>
            </TT.Menu1>
          </TT.Menu>
          <TT.Center></TT.Center>
          <TT.TextBox>
            <img
              id="somsom"
              src={`${process.env.PUBLIC_URL}/images/SomSom.svg`}
              alt="somsom"
            />
          </TT.TextBox>
        </TT.Table>
        <TT.Footer>
          <img
            src={`${process.env.PUBLIC_URL}/images/Footer.svg`}
            alt="footer"
          />
        </TT.Footer>
      </TT.Container>
    );
  };
};
export default TimeTable;
